 counter; // number of quarantine days\\n        bool hasRecord;\\n    }\\n\\n    // exist or not\\n    modifier checkUser(address id) {\\n        User storage u = users[id];\\n        require(u.hasRecord);\\n        // require(u.record_size > 0);\\n        _;\\n    }\\n\\n    //add user\\n    function addUser(\\n        string memory _name,\\n        uint256 _temp,\\n        bool _hasSymp,\\n        uint256 _date\\n    ) public {\\n        User storage u = users[msg.sender];\\n        Record memory rec;\\n        require(u.record_size == 0);\\n        rec.temp = _temp;\\n        rec.hasSymp = _hasSymp;\\n        rec.date = _date;\\n        uint256 total_;\\n        uint256 code_;\\n        //initial state\\n        if (_temp <= 37 && !_hasSymp) {\\n            //green\\n            total_ = 0;\\n            code_ = 0;\\n        } else if (_temp <= 37 && _hasSymp) {\\n            //yellow\\n            total_ = 7;\\n            code_ = 1;\\n        } else {\\n            //red\\n            total_ = 14;\\n            code_ = 2;\\n        }\\n\\n        users[msg.sender] = User({\\n            name: _name,\\n            id: msg.sender,\\n            record_size: 1,\\n            code: code_,\\n            total: total_,\\n            counter: 0,\\n            hasRecord: true\\n        });\\n        users[msg.sender].records[0] = rec;\\n    }\\n\\n    function addRecord(uint256 _temp, bool _hasSymp, uint256 _date)\\n        public\\n        checkUser(msg.sender)\\n    {\\n        User storage u = users[msg.sender];\\n        Record storage last_rec = u.records[u.record_size - 1];\\n        Record memory new_rec = Record(_temp, _hasSymp, _date);\\n        if (new_rec.date - last_rec.date > day_as_int) {\\n            u.code = 2;\\n            u.total = 14;\\n            u.counter = 0;\\n        } else {\\n            if (_temp <= 37 && !_hasSymp) {\\n                u.counter = u.counter + 1;\\n                if (u.counter >= u.total) {\\n                    u.code = 0; //change into green code\\n                }\\n            } else {\\n                if (u.code == 0) {\\n                    if (_temp > 37) {\\n                        //green to red\\n                        u.code = 2;\\n                        u.total = 14;\\n                    } else if (_hasSymp) {\\n                        // green to yellow\\n                        u.code = 1;\\n                        u.total = 7;\\n                    }\\n                }\\n                if (u.code == 1 && _temp > 37) {\\n                    //yellow to red\\n                    u.code = 2;\\n                    u.total = 14;\\n                }\\n                u.counter = 0; //resume when unhealthy\\n            }\\n        }\\n        u.records[u.record_size] = new_rec;\\n        u.record_size = u.record_size + 1;\\n    }\\n\\n    function hasRecord() public view returns (bool) {\\n        User storage u = users[msg.sender];\\n        return u.hasRecord;\\n    }\\n\\n    function getUserCode() public view checkUser(msg.sender) returns (uint256) {\\n        User storage u = users[msg.sender];\\n        return u.code;\\n    }\\n\\n    function getsRecord(uint256 today, uint256 gap)\\n        public\\n        view\\n        checkUser(msg.sender)\\n        returns (uint256, uint256, bool)\\n    {\\n        uint256 i;\\n        User storage u = users[msg.sender];\\n        for(i = 0; i < u.record_size; i++)\\n        {\\n            Record storage rec = u.records[i];\\n            if ((today - rec.date)/day_as_int == gap) {\\n                return (rec.date, rec.temp, rec.hasSymp);\\n            }\\n        }\\n    }\\n}\\n","sourcePath":"/Users/rymaspic/Courses/CloudComputing/CC/Cloud-Computing-Project/contracts/healthRecord.sol","ast":{"absolutePath":"/Users/rymaspic/Courses/CloudComputing/CC/Cloud-Computing-Project/contracts/healthRecord.sol","exportedSymbols":{"HealthRecord":[499]},"id":500,"nodeType":"SourceUnit","nodes":[{"id":38,"literals":["solidity","^",